import React from "react";

import "./App.css";

function App() {
  return (
    <div className="App">
      <div class="row hero">
        <div class="column center">
          <img src="../../assets/logo.svg" rel="icon" alt="" class="logo" />
          <h1 class="fin">Fin</h1>
          <p class="tag-line">Financial Account Management</p>
        </div>
      </div>

      <div class="column login-container">
        <h2>Sign In</h2>

        <div class="inputs"></div>
      </div>
    </div>
  );
}

export default App;
